import { Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

import "./Style.css";

export default function Service() {
  return (
    <div id="service">
      <div class="h-100 d-inline-flex flex-row align-items-center " id="grid">
        <div class="badge  p-2 mx-4  " id="box-1">
          Design Graphique
        </div>
        <div class="badge  p-2 mx-4 " id="box-2">
          Digital Content
        </div>
        <div class="badge  p-2 mx-4 " id="box-3">
          Site Web
        </div>
      </div>
    </div>
  );
}
